    console.log(data);
    console.log(data.map(({ acessos }) => Number(acessos)));
  }, [data]);

  return (
    <section className={`${styles.graph} animeLeft`}>
      <div className={styles.total}>
        <p>Acessos: {total}</p>
      </div>
    </section>
  );
};

